ll, "edge_info": {"relationship_name": "signed_contract_with", "source_node_id": "3fd14c77-a8d5-5f60-8ac9-d47efca9c6bd", "target_node_id": "edf92ddf-8f2f-5806-b67d-119fefe463f7", "ontology_valid": false}}, {"source": "1f0f11b6-fc44-5d90-a273-8b1716c84890", "target": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relation": "is_a", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"source_node_id": "1f0f11b6-fc44-5d90-a273-8b1716c84890", "target_node_id": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relationship_name": "is_a", "updated_at": "2025-10-15 15:01:06"}}, {"source": "1f0f11b6-fc44-5d90-a273-8b1716c84890", "target": "4406d9ba-ca14-52c3-9287-1d3828a4259f", "relation": "signed_contract_with", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"relationship_name": "signed_contract_with", "source_node_id": "1f0f11b6-fc44-5d90-a273-8b1716c84890", "target_node_id": "4406d9ba-ca14-52c3-9287-1d3828a4259f", "ontology_valid": false}}, {"source": "db48eeab-f3ad-5b95-82b0-e9b70f35f066", "target": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relation": "is_a", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"source_node_id": "db48eeab-f3ad-5b95-82b0-e9b70f35f066", "target_node_id": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relationship_name": "is_a", "updated_at": "2025-10-15 15:01:06"}}, {"source": "db48eeab-f3ad-5b95-82b0-e9b70f35f066", "target": "dd567000-6e56-53d7-9662-0688d47a2513", "relation": "signed_contract_with", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"relationship_name": "signed_contract_with", "source_node_id": "db48eeab-f3ad-5b95-82b0-e9b70f35f066", "target_node_id": "dd567000-6e56-53d7-9662-0688d47a2513", "ontology_valid": false}}, {"source": "9e960ffe-9201-5e88-96e0-9d575d3f6dc6", "target": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relation": "is_a", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"source_node_id": "9e960ffe-9201-5e88-96e0-9d575d3f6dc6", "target_node_id": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relationship_name": "is_a", "updated_at": "2025-10-15 15:01:06"}}, {"source": "9e960ffe-9201-5e88-96e0-9d575d3f6dc6", "target": "60b22a22-c746-543f-9215-1e787b8ec6dd", "relation": "signed_contract_with", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"relationship_name": "signed_contract_with", "source_node_id": "9e960ffe-9201-5e88-96e0-9d575d3f6dc6", "target_node_id": "60b22a22-c746-543f-9215-1e787b8ec6dd", "ontology_valid": false}}, {"source": "168ac81c-ee7f-5315-a902-e9a93bcbd303", "target": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relation": "is_a", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"source_node_id": "168ac81c-ee7f-5315-a902-e9a93bcbd303", "target_node_id": "c4e1a68b-9ada-54b4-be2e-00dd7e6f6d1c", "relationship_name": "is_a", "updated_at": "2025-10-15 15:01:06"}}, {"source": "168ac81c-ee7f-5315-a902-e9a93bcbd303", "target": "8dc54624-4826-5002-8097-3d26de58c4dd", "relation": "signed_contract_with", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"relationship_name": "signed_contract_with", "source_node_id": "168ac81c-ee7f-5315-a902-e9a93bcbd303", "target_node_id": "8dc54624-4826-5002-8097-3d26de58c4dd", "ontology_valid": false}}, {"source": "13bc7963-db5c-5eda-a970-0df693d26a54", "target": "17906c09-1f5f-5751-91dc-2edbd7cbf6e5", "relation": "made_from", "weight": null, "all_weights": {}, "relationship_type": null, "edge_info": {"source_node_id": "13bc7963-db5c-5eda-a970-0df693d26a54", "target_node_id": "17906c09-1f5f-5751-91dc-2edbd7cbf6e5", "relationship_name": "made_from", "updated_at": "2025-10-15 15:01:06"}}];

            var svg = d3.select("svg"),
                width = window.innerWidth,
                height = window.innerHeight;

            var container = svg.append("g");
            var tooltip = d3.select("#tooltip");

            var simulation = d3.forceSimulation(nodes)
                .force("link", d3.forceLink(links).id(d => d.id).strength(0.1))
                .force("charge", d3.forceManyBody().strength(-275))
                .force("center", d3.forceCenter(width / 2, height / 2))
                .force("x", d3.forceX().strength(0.1).x(width / 2))
                .force("y", d3.forceY().strength(0.1).y(height / 2));

            var link = container.append("g")
                .attr("class", "links")
                .selectAll("line")
                .data(links)
                .enter().append("line")
                .attr("stroke-width", d => {
                    if (d.weight) return Math.max(2, d.weight * 5);
                    if (d.all_weights && Object.keys(d.all_weights).length > 0) {
                        var avgWeight = Object.values(d.all_weights).reduce((a, b) => a + b, 0) / Object.values(d.all_weights).length;
                        return Math.max(2, avgWeight * 5);
                    }
                    return 2;
                })
                .attr("class", d => {
                    if (d.all_weights && Object.keys(d.all_weights).length > 1) return "multi-weighted";
                    if (d.weight || (d.all_weights && Object.keys(d.all_weights).length > 0)) return "weighted";
                    return "";
                })
                .on("mouseover", function(d) {
                    // Create tooltip content for edge
                    var content = "<strong>Edge Information</strong><br/>";
                    content += "Relationship: " + d.relation + "<br/>";
                    
                    // Show all weights
                    if (d.all_weights && Object.keys(d.all_weights).length > 0) {
                        content += "<strong>Weights:</strong><br/>";
                        Object.keys(d.all_weights).forEach(function(weightName) {
                            content += "&nbsp;&nbsp;" + weightName + ": " + d.all_weights[weightName] + "<br/>";
                        });
                    } else if (d.weight !== null && d.weight !== undefined) {
                        content += "Weight: " + d.weight + "<br/>";
                    }
                    
                    if (d.relationship_type) {
                        content += "Type: " + d.relationship_type + "<br/>";
                    }
                    
                    // Add other edge properties
                    if (d.edge_info) {
                        Object.keys(d.edge_info).forEach(function(key) {
                            if (key !== 'weight' && key !== 'weights' && key !== 'relationship_type' && 
                                key !== 'source_node_id' && key !== 'target_node_id' && 
                                key !== 'relationship_name' && key !== 'updated_at' && 
                                !key.startsWith('weight_')) {
                                content += key + ": " + d.edge_info[key] + "<br/>";
                            }
                        });
                    }
                    
                    tooltip.html(content)
                        .style("left", (d3.event.pageX + 10) + "px")
                        .style("top", (d3.event.pageY - 10) + "px")
                        .style("opacity", 1);
                })
                .on("mouseout", function(d) {
                    tooltip.style("opacity", 0);
                });

            var edgeLabels = container.append("g")
                .attr("class", "edge-labels")
                .selectAll("text")
                .data(links)
                .enter().append("text")
                .attr("class", "edge-label")
                .text(d => {
                    var label = d.relation;
                    if (d.all_weights && Object.keys(d.all_weights).length > 1) {
                        // Show count of weights for multiple weights
                        label += " (" + Object.keys(d.all_weights).length + " weights)";
                    } else if (d.weight) {
                        label += " (" + d.weight + ")";
                    } else if (d.all_weights && Object.keys(d.all_weights).length === 1) {
                        var singleWeight = Object.values(d.all_weights)[0];
                        label += " (" + singleWeight + ")";
                    }
                    return label;
                });

            var nodeGroup = container.append("g")
                .attr("class", "nodes")
                .selectAll("g")
                .data(nodes)
                .enter().append("g");

            var node = nodeGroup.append("circle")
                .attr("r", 13)
                .attr("fill", d => d.color)
                .call(d3.drag()
                    .on("start", dragstarted)
                    .on("drag", dragged)
                    .on("end", dragended));

            nodeGroup.append("text")
                .attr("class", "node-label")
                .attr("dy", 4)
                .attr("text-anchor", "middle")
                .text(d => d.name);

            node.append("title").text(d => JSON.stringify(d));

            simulation.on("tick", function() {
                link.attr("x1", d => d.source.x)
                    .attr("y1", d => d.source.y)
                    .attr("x2", d => d.target.x)
                    .attr("y2", d => d.target.y);

                edgeLabels
                    .attr("x", d => (d.source.x + d.target.x) / 2)
                    .attr("y", d => (d.source.y + d.target.y) / 2 - 5);

                node.attr("cx", d => d.x)
                    .attr("cy", d => d.y);

                nodeGroup.select("text")
                    .attr("x", d => d.x)
                    .attr("y", d => d.y)
                    .attr("dy", 4)
                    .attr("text-anchor", "middle");
            });

            svg.call(d3.zoom().on("zoom", function() {
                container.attr("transform", d3.event.transform);
            }));

            function dragstarted(d) {
                if (!d3.event.active) simulation.alphaTarget(0.3).restart();
                d.fx = d.x;
                d.fy = d.y;
            }

            function dragged(d) {
                d.fx = d3.event.x;
                d.fy = d3.event.y;
            }

            function dragended(d) {
                if (!d3.event.active) simulation.alphaTarget(0);
                d.fx = null;
                d.fy = null;
            }

            window.addEventListener("resize", function() {
                width = window.innerWidth;
                height = window.innerHeight;
                svg.attr("width", width).attr("height", height);
                simulation.force("center", d3.forceCenter(width / 2, height / 2));
                simulation.alpha(1).restart();
            });
